The American College of Obstetricians and Gynecologists (ACOG) defines PPH as a blood loss of:

* 500 mL or more for vaginal births;
* 1000 mL or more for cesarean sections;

or any amount of bleeding that causes signs or symptoms of hypovolemia,such as:

* Tachycardia (rapid heart rate);
* Hypotension (low blood pressure);
* Pallor (paleness);
* Dizziness or lightheadedness;

